import React from "react";
import { Container, Grid, Typography } from "@material-ui/core";

export const Register = () => {
  return (
    <div>
      <Container component="main" maxWidth="sm">
        <Grid container>
          <Grid item xs={12}>
            <Typography
              variant="h4"
              component="h4"
              className="d-flex justify-content-center my-5"
            >
              Register!
            </Typography>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};
